import React from 'react';
import back from "../images/BACK.webp";
import '../components/main.css';

const Header = () => {
    const openProfileEdit = () => {
        // Ensure the path matches the route defined in your App component
        window.open('/profile-edit', '_blank', 'noopener,noreferrer');
    };

    return (
        <div style={{ position: "relative", height: "810px", width: "100%" }}>
            <img 
                className='img' 
                src={back} 
                alt="Banner" 
            />
            <h1 className="text">
                Content Creator Profile
            </h1>
            <div className="details">
                <p><strong>Name:</strong> John Doe</p>
                <p><strong>Email:</strong> john.doe@example.com</p>
                <p><strong>Language:</strong> English</p>
                <p><strong>Education:</strong> Bachelor's Degree in Computer Science</p>
                <p><strong>Specialization:</strong> Web Development</p>
                <div className="social-media">
                    <a href="https://twitter.com/johndoe" target="_blank" rel="noopener noreferrer">
                        <i className="fab fa-twitter"></i>
                    </a>
                    <a href="https://linkedin.com/in/johndoe" target="_blank" rel="noopener noreferrer">
                        <i className="fab fa-linkedin-in"></i>
                    </a>
                    <a href="https://github.com/johndoe" target="_blank" rel="noopener noreferrer">
                        <i className="fab fa-github"></i>
                    </a>
                </div>
            </div>
            <button onClick={openProfileEdit} className="profile-icon">
                <i className="fas fa-user"></i> {/* Profile icon */}
            </button>
        </div>
    );
};

export default Header;
